          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](107, "Deixe mergulhado em \xE1gua o lombo, a carne seca e a costela salgada. V\xE1 trocando a \xE1gua para dessalgar as carnes. Deixe o feij\xE3o preto tamb\xE9m de molho \xE0 noite, v\xE9spera de quando voc\xEA ir\xE1 cozinhar a feijoada. No dia seguinte, cozinhe as carnes que estavam de molho em uma panela de press\xE3o. Quando estiverem cozidas, corte as carnes em peda\xE7os pequenos. Ponha o feij\xE3o para cozinhar em um caldeir\xE3o grande com a ling\xFCi\xE7a calabresa, a ling\xFCi\xE7a portuguesa, os paios e a costelinha de porco defumada cortada em peda\xE7os, juntamente com a folha de louro. Quando as ling\xFCi\xE7as e os paios estiverem cozidos, separe-os e corte-os em rodelas mais ou menos grossas. A parte, fa\xE7a um refogado em azeite com as cebolas, os alhos espremidos e deixe dourar bem. Quando estiver bem dourado, adicione os peda\xE7os de toucinhos defumados para fritar. Passe estes temperos j\xE1 refogados para a panela que est\xE1 o feij\xE3o com as carnes. Deixe pegar gosto e o caldo do feij\xE3o engrossar. Sirva com arroz branco, farofa, couve refogada, banana a milanesa e ling\xFCi\xE7a calabresa fresca frita");

